import React, { FC, memo } from 'react';
import './Projects.scss';
import { joinStrings } from '../utils/utils';

type Props = {
  title: string;
  description: string;
  image: string;
  link: string;
};

const SingleProject: FC<Props> = ({ description, image, title, link }) => {
  return (
    <div className={joinStrings(['single-project', `single-project--${title.replace(' ')}`])}>
      <a href={link} target='blank' className='single-project__image'>
        <img src={image} alt={title} />
      </a>
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  );
};

export default memo(SingleProject);
